static StbGLProc stbGLGetProcAddressDefaultImpl(const char *procName)
{
    StbGLProc proc;
#if defined(__EMSCRIPTEN__)
    proc = (StbGLProc)emscripten_GetProcAddress(procName);
#elif defined(_WIN32)
    proc = (StbGLProc)GetProcAddress(s_stbGLLib, procName);
    if (!proc)
    {
        proc = (StbGLProc)wglGetProcAddress(procName);
    }
#else
    *(void **)(&proc) = dlsym(s_stbGLLib, procName);
#endif
    return proc;
}

